import {Component, NgModule} from '@angular/core';
import {HttpClient, HttpClientModule} from '@angular/common/http';
@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})

export class AppComponent {
  title = 'Homework4';
  starter_url = 'https://www.alphavantage.co/query?function=';
  stock_symbol = '';
  url = '';
  api_key = 'XGN36Q0ICTGL1ZWD';
  constructor(private http: HttpClient) { }

  generateStockUrl(){
    this.url = this.starter_url + 'TIME_SERIES_INTRADAY&symbol=' + this.stock_symbol + '&interval=5min&apikey=' + this.api_key;
    this.http.get(this.url).subscribe((data) => {
      console.log(data);
  });
}
}
<h1>Pick which commoditiy you want to view</h1>


<h2>Forex</h2>
<h2>Commodities</h2>
<h2>Technical indicators</h2>


<nav>
  <a [routerLink]="'/'">Home</a>
  <h2>Stock symbol</h2>
  <input type="text" [(ngModel)]="stock_symbol">
  <button (click)="generateStockUrl()" [routerLink]="'/data/' + stock_symbol">View</button>
</nav>
<router-outlet></router-outlet>
